I am trying to dynamically change the name of key of the object for that I have implemented [Custom transforms](https://juanjodiaz.github.io/json2csv/#/advanced-options/transforms?id=custom-transforms)

Here is the sample code:
```javascript
jsonToCSV = async (file, body) => {
    try {
      const opts = {
        transforms: [
          unwind({ paths: ['det_rates','note', 'outside'], blankOut: true }),
          flatten({ object: false, array: true, separator: '_'}),
          this.modifyFieldName(JSON_CSV_KEYS)
        ]
      }
      const { createReadStream, createWriteStream } = fs;
      const parser = new Transform(opts);
      const inputPath = file.path;
      const outputPath = join(process.cwd(),'analytics.csv');
      const input = createReadStream(inputPath, { encoding: 'utf8' });
      const output = createWriteStream(outputPath, { encoding: 'utf8' });
      const processor = input.pipe(parser);
      processor.pipe(output);
      return processor;
    } catch (error) {
      throw new Error(error);
    }
  }

modifyFieldName = (JSON_CSV_KEYS) => {
    return (item) => {
      const keys = Object.keys(item);
      let keyIndex = -1;
      for (let [index, mapKey] of JSON_CSV_KEYS.DETECTION_MAP.OLD_KEYS.entries()) {
        keyIndex = keys.findIndex((key) => {
          //logger.debug('item_key', key);
          //logger.debug('map_key', mapKey);
          return key.includes(mapKey);
        });
        //logger.debug('keyIndex', keyIndex);
         if(keyIndex != -1) {
           let newKey = JSON_CSV_KEYS.DETECTION_MAP.NEW_KEYS[index];
           let oldKey = keys[keyIndex];
           delete Object.assign(item, {[newKey]: item[oldKey] })[oldKey];
         }
      }
      
      // logger.debug('item', item);
      return item;
    }
  }
```

Somehow I am getting completely wrong item in the output, I guess that might be because of async behaviour.

